import './App.css';
import Films from "./components/Movie/Films";
import NavBar from "./components/NavBar/NavBar";
import FilmsPage from "./components/Movie/FilmsPage";

function App() {
    return (
        <div className='App'>
            <NavBar/>
            <Films/>
            <Route>
                <FilmsPage/>
            </Route>

        </div>
    );
}

export default App;
